import { AddOneProductAction, AddProductsAction } from "../store/productsReducer";

export const fetchProducts2 = (id) => {
  return function (dispatch) {
    let url = `http://localhost:3333/products/${id}`;
    fetch(url)
      .then((res) => res.json())
      .then((data) => {
      dispatch(AddOneProductAction(data));
  });
}
}
